resources.string:
Các phiên bản chữ ký tương ứng với phiên bản Android:
V1 - tùy chọn chữ ký đầu tiên, và là tùy chọn duy nhất cho đến Android 7.0;
V2 - được thêm vào từ Android 7.0;

Phiên bản chữ ký nên được sử dụng dựa trên phiên bản Android tối thiểu/mục tiêu cho ứng dụng. Nếu phiên bản mục tiêu là 30+ (Android 11+), thì chữ ký V2 là bắt buộc.

Nếu bạn không đánh dấu vào "Lưu", thì các tuỳ chọn đã chọn sẽ chỉ được sử dụng trong lần này.

Các phiên bản chữ ký tương ứng với phiên bản Android:
V1 – tùy chọn chữ ký đầu tiên, và là tùy chọn duy nhất cho đến Android 7.0;
V2 – được thêm vào từ Android 7.0;
V3 – được thêm vào từ Android 9.0;
V4 – được thêm vào từ Android 11;

Phiên bản chữ ký nên được sử dụng dựa trên phiên bản Android tối thiểu/mục tiêu cho ứng dụng. Nếu phiên bản mục tiêu là 30+ (Android 11+), thì chữ ký V2 là bắt buộc. V2 hoặc V3 phải được sử dụng cùng với chữ ký V4. Tuy nhiên, hiện tại chữ ký V4 hầu như chưa được sử dụng.

Nếu bạn không đánh dấu vào "Lưu", thì các tuỳ chọn đã chọn sẽ chỉ được sử dụng trong lần này.
